CREATE TABLE  PRODUCTOS
(
    ID int auto_increment primary key not null,
    MARCA VARCHAR(100) NOT NULL ,
    PAIS_DE_ORIGEN VARCHAR(50),
    DESCRIPICION_A VARCHAR(200) NOT NULL ,
    DESCRIPCION_B VARCHAR(200),
    TALLA int(2) NOT NULL ,
    CANTIDAD int NOT NULL ,
    COLOR VARCHAR(50) NOT NULL , 
    CATEGORIA VARCHAR(50) NOT NULL ,
    GENERO VARCHAR(50) NOT NULL ,
    TIPO VARCHAR(40),
    PRECIO_DE_COMPRA int NOT NULL ,
    PRECIO_DE_VENTA int NOT NULL ,
    UBICACION_DEL_ALMACEN int NOT NULL ,
    UBICACION_DEL_ARMAZON int NOT NULL,
	MARCA_ID int,
    foreign key (MARCA_ID)
    references marcas(ID),
    foreign key (MARCA)
    references marcas(Nombre_Marca)
);



